import React from 'react';
import logo from './logo.svg';
import ReactDOM from 'react-dom';
import './App.css';
import Header from './component/header/header'
class App extends React.Component {
  render()
  {
  return (
    <div>
      <Header />
      <section class="home_banner">
          <article id="home_slider" class="owl-carousel">
              <div class="item">
                  <img src="images/home_banner1.jpg" alt="" />
                  <div class="caption">
                      <div class="b_title">
                          <a class="play_icon" data-toggle="modal" data-target="#homevideo_pop"><img src="images/icon_play.png" alt="" /></a>
                          <h2>Jabariya jodi</h2>
                          <p>1 hr 42 mins <span></span> Action, Adventure, Animation</p>
                      </div>
                  </div>
              </div>
          </article>
          <div class="clearfix"></div>
      </section>
    </div>
  );
}
}
export default App;
